import React from "react";

const Speakers = ({ speak }) => {
  return (
    <div>
      {speak.map(({ imageSrc, name }) => {
        return (
          <>
            <img src={`/images/${imageSrc}.png`} alt={name} key={imageSrc} />
          </>
        );
      })}
    </div>
  );
};

const EnhancedSpeakerComponent = withData(Speakers);

function withData(Component) {
  return function () {
    <Component speak={speak}></Component>;
  };
}

export default EnhancedSpeakerComponent;
